import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch, withRouter, Link } from "react-router-dom"
import {
    Posts,
    Account,
    Home,
    Login,
    Navbar,
} from './Components'


const App = () => {

    return (
        // <div id='navBar'>
        //     <link>Home</link> | <Link>Account</Link>
        // </div>

        <div id='content'>
            <link to='/'>Home</link>
            <Route path="/">
                <h1> Stranger's Things</h1>
                <Home />
                <h1>Posts</h1>
                <Login />

            </Route>
            <Router exact path='/account'>
                <Account />
            </Router>

            <Route path='/posts'>
                <Posts />
            </Route>
            <Route path='/login'>
                <Login />
            </Route>

        </div>)
}

ReactDOM.render(
    <Router>
        <App />,
    </Router>,
    document.getElementById('app'),
);
